import React from 'react';
import { Col, Row, Button, Form } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';

const ChatPage = () => {
    return(
        <>
            <Row>
                <Box style={{width: "400px", height: "250px"}} text="PT Video" />
                <Col></Col>
                {/* <Col>
                    <Box style={{width: "500px", height: "500px"}} text="Chat"/>
                </Col> */}
            </Row>
            <br></br>
            <Row>
                <Box style={{width: "400px", height: "250px"}} text="Patient Video" />
            </Row>
        </>
    );
}

export default ChatPage;
